import React, { Component } from 'react';
import "./About.css";
import profile_pic_name from "../assets/profile_pic_name.jpg";
export default class About extends Component {
  render() {
    return (
      <div>
        <h1>About me</h1> 
        

       <div>
       <div class="split left">
         <div className="centered">
           <img 
             className="profile_image"
             src = {profile_pic_name}
             alt="Profile Pic"
             ></img>
         </div>
       </div>
       <div className="split right">
         <div className="centered">
           <div className="name_title">Anwuli Ajabor</div>
           <div className="brief_description">
             <p>I am a rising Sophmore in Florida institute of technology. I like music and dancing.</p>
             
             </div>
           </div>
         </div>
       </div>
     </div>
   
    )
  }
}
